import React from 'react';
import { Link } from 'react-router-dom';

import img from '../assets/logo-tripp.png';

import './style.css';

function Header() {
    return (
        <header className="page-header">
            <div className="top-bar-container">
                <div className="logo-header">
                    <Link to="/">
                        <img imagem="../assets/logo-trigg.png" alt="Logo Trigg"/>
                    </Link>
                </div>

                <ul>
                    <li><a href="www.google.com.br">Conheça a Trigg</a></li>
                    <li><a href="www.google.com.br">Cartão de Crédito</a></li>
                    <li><a href="www.google.com.br">Cashback</a></li>
                    <li><a href="www.google.com.br">Dúvidas ?</a></li>
                </ul>
            </div>
        </header>
    );
}

export default Header;
